import axios from 'axios';
import { API } from '../config';

export const signup = (user) => {
  return axios({
    method: 'post',
    url: `${API}/signup`,
    data: JSON.stringify(user),
  })
  .then((resp) => resp.data)
  .catch((err) => console.log(err));
}
